% Een groepje kinderen speelt in een tuin en een oude man staat op de achtergrond
sid_tts(1,
  [
    ( ( (en:en:'CC', s:dcl~>s:dcl~>s:dcl)
      @ ( ( (speelt:spelen:'VB', pp~>np~>s:dcl)
          @ ( (in:in:'IN', np~>pp)
            @ ( (een:een:'DT', n~>np)
              @ (tuin:tuin:'NN', n) ) ) )
        @ ( (kinderen:kind:'NN', np~>np)
          @ ( ('Een':een:'DT', n~>np)
            @ (groepje:groep:'NN', n) ) ) ) )
    @ ( ( (staat:staan:'VB', pp~>np~>s:dcl)
        @ ( (op:op:'IN', np~>pp)
          @ ( (de:de:'DT', n~>np)
            @ (achtergrond:achtergrond:'NN', n) ) ) )
      @ ( (oude:oud:'JJ', np~>np)
        @ ( (een:een:'DT', n~>np)
          @ (man:man:'NN', n) ) ) ) )
  ]).

